import React from 'react'
import './BurgerButton.css'

const BurgerButton = props => {
  return (
    <div className='menu'>
      <button type='button' id='menu-icon' onMouseDown={e => props.handleMouseDown(e)}></button>
    </div>
  )
}

export default BurgerButton
